import Post from './Post'

const Posts = (props) =>{
 //   console.log(props.posts)
    return(<p>helo</p>)
    return(
        <div>

            {props.posts.map(post=>{
                return(
                    <Post username={post.username} content={post.content} id={post.id} likes={post.likes}/>
                )
            })}
        </div>
    )
}

export default Posts;
